import React, {Component} from "react";
import "./StartPage.css";
import LoginBox from "../components/LoginBox";

class StartPage extends Component() {
  static defaultProps = {
    num:1
  }
  render(){
  return (
    <div className="Background">
      <div className="WhiteBox">
        <LoginBox></LoginBox>
        <p>{this.props.num}</p>
      </div>
    </div>
  );
  }
}

export default StartPage;
